import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with networkidle state
    await page.goto(fileUrl, { waitUntil: 'networkidle' });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for cart element to be visible using multiple selector strategies
    await page.waitForSelector('.cart', { state: 'visible' });

    // Click the cart using a more specific selector strategy
    const cartElement = await page.$('div.cart:has-text("Cart")');
    await cartElement.click();

    // Wait for cart modal to appear using the checkout button as confirmation
    await page.waitForSelector('.checkout-btn', { state: 'visible' });

    // Take screenshot after opening cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract cart information to verify success
    const cartCount = await page.$eval('.cart', el => el.textContent.trim());
    const checkoutVisible = await page.$eval('.checkout-btn', el => el.offsetParent !== null);

    return {
      success: true,
      action: "Successfully opened shopping cart modal",
      extractedData: {
        cartCount: cartCount,
        checkoutButtonVisible: checkoutVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open shopping cart modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
